import React from 'react';
import { IonProgressBar } from '@ionic/react';

const ProgressBar: React.FC = () => {
    return (
        <IonProgressBar className="word-bar" value={0.32}>
            
        </IonProgressBar>
    );
  };
  
export default ProgressBar;
